<h1>POP</h1>
<a name="io.jumpco.open.kfsm.TransitionType.POP"></a>
<code><span class="identifier">POP</span></code>
<p>A pop transition will pop the stack and make the transition current. If the pop transition provided a new targetMap or targetState that will result in push or normal transition behaviour.</p>
